// Create a functional component
const UserInput = (props) => {
    return (
        <div>
            <h1>Input</h1>
            <input 
            onClick={props.changeUserName()}
            onChange={props.changeUserName()} type="text" placeholder="Name"/> 
        </div>
    )    

}
export default UserInput
